import React from "react";
import UserData from "../Post/MOCK_DATA.json";
import style from './UsersList.module.css';
import Card from '../UI'

function UserList() {
  return (
    <div>
      <table className={style.userTable}>
        <th>First Name</th>
        <th>Last Name</th>
        <th>Email</th>
        <th>Gender</th>

        {UserData.map((user) => {
          return (
            <tr key={user.id}>
              <td> {user.first_name}</td>
              <td> {user.last_name}</td>
              <td> {user.email}</td>
              <td> {user.gender}</td>
            </tr>
          );
        })}
      </table>
    </div>
  );
}

export default UserList;
